if mibBuilder.loadTexts: mcmVNETSysControlActionCmd.setDescription("NAME = ; DESC = Setting this object will perform various \\ actions on the VNET voice system. \\ Note: Starting with software release 3.0, \\ the enumerations clearNetworkCounters (1) and \\ clearChannelCounters (3) are not supported. \\ The enumeration is included here only to support \\ backwards compatibility for software versions \\ prior to release 3.0.; HELP = 1: clear network statistics counters. \\ 2: perform hardware reset to all channels. \\ 3: clear all channel statistics counters. \\ 4: download code to all channels. \\ 5: disconnect all channel's calls. \\ 6: set all channels to loopback mode. \\ 7: terminate all channel's tests. \\ 8: force connect all channels by using the auto call numbers. NOTE: This option is not \\ supported by the ISDN BRI voice card.; \\ 9: re-register phone number.; CAPABILITIES = NET_OPER, VPN_OPER ;")
